import logo from './logo.svg';
import './App.css';
import ExternalComponent from './Components/ExternalComponent';
import FormComponent from './Components/FormComponent';
import React, { useState } from 'react';
function App() {
  const dummyIdeas = [
    { id: 1, title: 'Prank Travis', description: 'Stick googly eyes on all his stuff' },
    { id: 2, title: 'Make a secret password app', description: 'So you and your rideshare driver can both know neither one of you is lying' },
    { id: 3, title: 'Learn a martial art', description: 'To exact vengeance upon my enemies' },
  ]

  const emptyFormVals = {
    id: -1,
    title: '',
    description: '',
  }

  const [formValues, setFormVals] = useState(emptyFormVals)




  const [ideas, setIdeas] = useState(dummyIdeas)
  return (
    <div className="App">
      <h1>
      <FormComponent formValues={formValues} setFormVals={setFormVals} setIdeas={setIdeas}/>

        <ExternalComponent ideas={ideas} setIdeas={setIdeas}/>

      </h1>
    </div>
  );
}

export default App;
